  true,\n\t\"url\": null,\n\t\"notes\": \"The ERS Food Availability (Per Capita) Data
  System (FADS) includes three distinct but related data series on food and nutrient
  availability for consumption. The data serve as popular proxies for actual consumption
  at the national level. Food availability data are now updated through 2011, the
  most recent year available; these data are the foundation for the other two series.
  Loss-adjusted food availability data are also available through 2011 for most products
  but are preliminary estimates. Nutrient availability data are provided through 2006,
  as this data series has not yet been updated beyond 2006.\",\n\t\"license_title\":
